import React from "react";

import { Box, Container , Input, TextField } from "@material-ui/core";

function Login() {
  return (
    <Container>
      <Box>
        <TextField margin ="dense" label = "Username" placeholder="Username" variant = "outlined" />
      </Box>
      <Box> <TextField margin ="dense"  label = "Email" placeholder="Email"/></Box>
      <Box> <TextField label = "Password" margin ="dense"  placeholder="Username"/></Box>

    </Container>
  );
}
export { Login };
